INSERT INTO `openn_document` VALUES (1,'LJS 255','2014-10-23 13:18:46','2014-10-23 13:19:11',0,'ljs255',NULL,'ljs','Manuscript leaf from De casibus virorum illustrium','<?xml version=\'1.0\' encoding=\'UTF-8\'?>\n<TEI xmlns=\"http://www.tei-c.org/ns/1.0\" xmlns:tei=\"http://www.tei-c.org/ns/1.0\">\n   <teiHeader>\n      <fileDesc>\n         <titleStmt>\n            <title>Description of LJS 255 - Manuscript leaf from De casibus virorum illustrium (1425-1475)</title>\n         </titleStmt>\n         <publicationStmt>\n            <publisher>Schoenberg Center for Electronic Text and Image, University of Pennsylvania</publisher>\n            <availability>\n               <licence target=\"http://creativecommons.org/licenses/by-nc/4.0/legalcode\">\n                            This work and all referenced images are ©2014 University of Pennsylvania. They are licensed under a Creative Commons Attribution-NonCommercial 4.0 International License (CC BY-NC 4.0), http://creativecommons.org/licenses/by-nc/4.0/.\n                          </licence>\n            </availability>\n         </publicationStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno>LJS 255</idno>\n               </msIdentifier>\n               <msContents>\n                  <summary>Partial leaf from a mid-15th century copy of Laurent de Premerfait\'s second translation of Boccaccio\'s De casibus virorum illustrium, from the chapter on Theseus (10.1-17), beginning with the rubric Le Xe chappitre contient le cas de Theseus, roy dathenes, Et commence ou latin Athene. Written in lettre bâtarde by a single hand in France, possibly Paris, in 2 columns, bottom of the leaf missing, 48 lines extant out of approximately 60, frame-ruled in lead. Decorated on the recto with an unfinished (outlines and touches of color) 26-line miniature depicting the suicide of Phaedra in the larger upper section and Theseus in exile in Cyprus in the smaller lower section; a border of flowers, acanthus leaves, and gold ivy leaves above the left column and an unfinished (gold leaves only) border on the left side of the left column; and a 5-line initial in pink on gold ground.</summary>\n                  <textLang>French, Middle (ca. 1300-1600)</textLang>\n                  <msItem>\n                     <title>Manuscript leaf from De casibus virorum illustrium</title>\n                     <author>Boccaccio, Giovanni, 1313-1375</author>\n                  </msItem>\n               </msContents>\n               <physDesc>\n                  <decoDesc>\n                     <decoNote n=\"Side 1\">Illuminated miniature, unfinished, Side 1</decoNote>\n                     <decoNote n=\"Side 1\">Illuminated initial, Initial A, Side 1</decoNote>\n                     <decoNote n=\"Side 1\">Illuminated border, unfinished, Side 1</decoNote>\n                  </decoDesc>\n               </physDesc>\n               <history>\n                  <origin>\n                     <origDate>1425-1475</origDate>\n                     <origPlace/>\n                  </origin>\n               </history>\n            </msDesc>\n         </sourceDesc>\n      </fileDesc>\n   </teiHeader>\n   <facsimile>\n      <graphic url=\"\"/>\n   <surface n=\"Side 1\"><graphic height=\"1800px\" url=\"web/0001_0000_web.jpg\" width=\"1612px\"/><graphic height=\"5741px\" url=\"master/0001_0000.tif\" width=\"5142px\"/><graphic height=\"190px\" url=\"thumb/0001_0000_thumb.jpg\" width=\"170px\"/></surface><surface n=\"Side 2\"><graphic height=\"1800px\" url=\"web/0001_0001_web.jpg\" width=\"1612px\"/><graphic height=\"5741px\" url=\"master/0001_0001.tif\" width=\"5142px\"/><graphic height=\"190px\" url=\"thumb/0001_0001_thumb.jpg\" width=\"170px\"/></surface></facsimile>\n</