xt and Image, University of Pennsylvania</publisher>\n            <availability>\n               <licence target=\"http://creativecommons.org/licenses/by-nc/4.0/legalcode\">\n                            This work and all referenced images are ©2014 University of Pennsylvania. They are licensed under a Creative Commons Attribution-NonCommercial 4.0 International License (CC BY-NC 4.0), http://creativecommons.org/licenses/by-nc/4.0/.\n                          </licence>\n            </availability>\n         </publicationStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno>LJS 489</idno>\n               </msIdentifier>\n               <msContents>\n                  <summary>Letter written on parchment in the 4th or 5th century in the northern Hindu Kush region (in modern Afghanistan). 10 lines of Bactrian language in Greek cursive script in which Nawaz instructs Ram-yol, the recipient, to give good treatment to a third individual named Siz-bur. The letter is a palimpsest, written over an earlier, illegible document, with lines of the earlier writing visible in the margins on the left and bottom edges (no margins on right and top edges); writing is also visible on the verso. A strip almost cut away along the bottom edge is threaded through a clay seal of a divine face surrounded by a sunburst.</summary>\n                  <textLang>Iranian (Other)</textLang>\n                  <msItem>\n                     <title>Nawaz letter with seal</title>\n                  </msItem>\n               </msContents>\n               <history>\n                  <origin>\n                     <origDate>0300-0499</origDate>\n                     <origPlace/>\n                  </origin>\n               </history>\n            </msDesc>\n         </sourceDesc>\n      </fileDesc>\n   </teiHeader>\n   <facsimile>\n      <graphic url=\"\"/>\n   <surface n=\"Side 1\"><graphic height=\"1578px\" url=\"web/0004_0000_web.jpg\" width=\"1800px\"/><graphic height=\"2523px\" url=\"master/0004_0000.tif\" width=\"2877px\"/><graphic height=\"166px\" url=\"thumb/0004_0000_thumb.jpg\" width=\"190px\"/></surface><surface n=\"Side 2\"><graphic height=\"1578px\" url=\"web/0004_0001_web.jpg\" width=\"1800px\"/><graphic height=\"2523px\" url=\"master/0004_0001.tif\" width=\"2877px\"/><graphic height=\"166px\" url=\"thumb/0004_0001_thumb.jpg\" width=\"190px\"/></surface></facsimile>\n</TEI>\n');
